import React, { 
  Component 
} 
from 'react';

import {
  Jumbotron,
  VerticalLine,
  Display,
  Button,
  Grid
}
from "./components/bootstrap";

class App extends Component {
  render() {
    const layout = [
      7,  8,   9,  "/",
      4,  5,   6,  "X",
      1,  2,   3,  "-",
      0, ".", "=", "+"
    ];

    return (
      <Jumbotron width="30rem" center>
        <Display text="asdasd">
          <Button name="AC"/>
        </Display>

        <VerticalLine/>    

        <Grid columns={4}>
          {layout.map(button => <Button name={button}/>)}
        </Grid>
      </Jumbotron>
    );
  }
}

export default App;
